import {BrowserRouter as Router,Switch,Route} from "react-router-dom";
import './App.css';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component>{Note}</Route>
      </Switch>
    </Router>
  );
}

export default App;
